pragma solidity ^0.8.0;

interface IDemoTypes {
    function setBool(bool key) external;
    function getBool() external view returns (bool);

    function setUint8(uint8 key) external;
    function getUint8() external view returns (uint8);

    function setUint256(uint256 key) external;
    function getUint256() external view returns (uint256);

    function setStr(string memory key) external;
    function getStr() external view returns (string memory);

    function setAddres(address key) external;
    function getAddress() external view returns (address);

    function setBytes(bytes memory key) external;
    function getBytes() external view returns (bytes memory);

    function setArrayElement(uint256 index, uint256 value) external;
    function setArray(uint256[] memory values) external;
    function getArrayElement(uint256 index) external view returns (uint256);
    function addArrayElement(uint256 value) external;
    function getArrayLength() external view returns (uint256);

    function setStruct(uint256 id, string memory description) external;
    function getStruct() external view returns (uint256, string memory);
}

contract demoTypes{
    bool public boolVar;
    uint256 public uint256Var;
    uint8 public uint8Var;
    string public strVar;
    address public addressVar;
    bytes public bytesVar;
    uint256[] public dataArray;


    struct DemoStruct {
        uint256 id;
        string description;
    }

    DemoStruct public structInstance;

    function setBool(bool key) public {
        boolVar = key;
    }

    function getBool() public view returns (bool) {
        return boolVar;
    }

    function setUint8(uint8 key) public {
        uint256Var = key;
    }

    function getUint8() public view returns (uint8) {
        return uint8Var;
    }

    function setUint256(uint256 key) public {
        uint256Var = key;
    }

    function getUint256() public view returns (uint256) {
        return uint256Var;
    }

    function setStr(string memory key) public {
        strVar = key;
    }

    function getStr() public view returns (string memory) {
        return strVar;
    }

    function setAddres(address key) public {
        addressVar = key;
    }

    function getAddress() public view returns (address) {
        return addressVar;
    }

    function setBytes(bytes memory key) public {
        bytesVar = key;
    }

    function getBytes() public view returns (bytes memory) {
        return bytesVar;
    }

    function setArrayElement(uint256 index, uint256 value) public {
        require(index < dataArray.length, "Index out of bounds");
        dataArray[index] = value;
    }

    function setArray(uint256[] memory values) public {
        dataArray = values;
    }

    function getArrayElement(uint256 index) public view returns (uint256) {
        require(index < dataArray.length, "Index out of bounds");
        return dataArray[index];
    }

    function addArrayElement(uint256 value) public {
        dataArray.push(value);
    }

    function getArrayLength() public view returns (uint256) {
        return dataArray.length;
    }

    function setStruct(uint256 id, string memory description) public {
        structInstance = DemoStruct(id, description);
    }

    function getStruct() public view returns (uint256, string memory) {
        return (structInstance.id, structInstance.description);
    }

}
